import React, { Component } from 'react';
import './App.scss';
import untitled from './Untitled-1.png';
import Particles from 'react-particles-js';


const particlesparams = {
  "particles": {
    "number": {
      "value": 4,
      "density": {
        "enable": true,
        "value_area": 800

      }
    },
    "color": {
      "value": "#3aafa9"
    },
    "shape": {
      "type": "circle",
      "stroke": {
        "width": 0,
        "color": "#000000"
      },
      "polygon": {
        "nb_sides": 6
      },
      "image": {
        "src": "img/github.svg",
        "width": 100,
        "height": 100
      }
    },
    "opacity": {
      "value": 0.35,
      "random": false,
      "anim": {
        "enable": false,
        "speed": 1,
        "opacity_min": 0.1,
        "sync": false
      }
    },
    "size": {
      "value": 6,
      "random": false,
      "anim": {
        "enable": false,
        "speed": 40,
        "size_min": 0.1,
        "sync": false
      }
    },
    "line_linked": {
      "enable": false,
      "distance": 150,
      "color": "#ffffff",
      "opacity": 0.4,
      "width": 1
    },
    "move": {
      "enable": true,
      "speed": 1,
      "direction": "right",
      "random": false,
      "straight": false,
      "out_mode": "out",
      "bounce": false,
      "attract": {
        "enable": false,
        "rotateX": 600,
        "rotateY": 1200
      }
    }
  },
  "interactivity": {
    "detect_on": "canvas",
    "events": {
      "onhover": {
        "enable": true,
        "mode": "repulse"
      },
      "onclick": {
        "enable": true,
        "mode": "push"
      },
      "resize": true
    },
    "modes": {
      "grab": {
        "distance": 400,
        "line_linked": {
          "opacity": 1
        }
      },
      "bubble": {
        "distance": 400,
        "size": 40,
        "duration": 2,
        "opacity": 8,
        "speed": 3
      },
      "repulse": {
        "distance": 200,
        "duration": 0.4
      },
      "push": {
        "particles_nb": 4
      },
      "remove": {
        "particles_nb": 2
      }
    }
  },
  "retina_detect": true
}



class App extends Component {
  render() {
    return (
      <div className="App">
        <Particles className="particles"
          params={particlesparams}
        />
        <link href="https://fonts.googleapis.com/css?family=Oxygen:400,700&display=swap" rel="stylesheet"></link>
        <link href="https://fonts.googleapis.com/css?family=Karla:400,700&display=swap" rel="stylesheet"></link> 
        <body class="container">
          <div class="main">
            <div class="main__item"><span class="slash">/</span>Jay Pardel.</div>
          </div>
          <div class="navigation">
            <ul class="navigation__list">
              <li class="navigation__item">about</li>
              <li class="navigation__item">projects</li>
              <li class="navigation__item">contact</li>
            </ul>
          </div>


          <section class="home">
            <img class='home__bg' src={untitled} alt='background' />
            <div class="home__content">
              <h3 class="heading--3">hi, i am</h3>
              <div class="home__divider"></div>
              <h1 class="heading--1">Jay Pardel</h1>
              <h3 class="heading--3">Full Stack Web Developer</h3>


            </div>
          </section>



        </body>
      </div>
    );
  }
}


export default App;
